import React from "react";

const PageButton = ({
  text,
  details,
  totalPages,
  activePage,
  setActivePage,
  handle,
}) => {
  return (
    <div>
      <button
        className={`${details}  text-2xl font-bold border-gray-400 bg-azulgrisclaro hover:bg-azulgris text-black px-5 py-1`}
        onClick={handle}
        id={text}
      >
        {text}
      </button>
    </div>
  );
};

export default PageButton;
